import React, { useState } from "react";

function Base64ToJPEGConverter() {
  const [base64Image, setBase64Image] = useState(
    "data:image/png;base64,"
  ); // Your base64-encoded image data

  const convertToJPEG = () => {
    if (base64Image) {
      // Create a Blob object from the base64 data
      const byteCharacters = atob(base64Image);
      const byteNumbers = new Array(byteCharacters.length);
      for (let i = 0; i < byteCharacters.length; i++) {
        byteNumbers[i] = byteCharacters.charCodeAt(i);
      }
      const byteArray = new Uint8Array(byteNumbers);
      const blob = new Blob([byteArray], { type: "image/jpeg" });

      // Create a URL for the Blob
      const imageURL = URL.createObjectURL(blob);

      // Display the image
      setBase64Image(imageURL);
    }
  };

  return (
    <div>
      <div>
        <h2>Base64 to JPEG Converter</h2>
        <button onClick={convertToJPEG}>Convert to JPEG</button>
      </div>
      {base64Image && (
        <div>
          <h3>Converted JPEG Image:</h3>
          <img src={base64Image} alt="Converted JPEG" />
        </div>
      )}
    </div>
  );
}

export default Base64ToJPEGConverter;
